import React from "react";
import { BrowserRouter as Link } from "react-router-dom";
import { useHistory } from "react-router-dom";

import "./SideNav.css";

const SideNav = (props) => {
  const history = useHistory();

  const [selectedMenuItem, setSelectedMenuItem] = React.useState("users");

  return (
    <div className="sa-sidenav-w">
      <div className="logo center">A Strum Away</div>
      <div className="greeting center">
        <div>Welcome {props.userName}</div>
      </div>
      <div className="sa-menu">
        <Link>
          <div
            className={`sa-menu-link ${
              selectedMenuItem === "users" ? "selected" : ""
            }`}
            onClick={() => {
              history.push("/users");
              setSelectedMenuItem("users");
            }}
          >
            <div>Home</div>
          </div>
        </Link>
        <Link>
          <div
            className={`sa-menu-link ${
              selectedMenuItem === "profile" ? "selected" : ""
            }`}
            onClick={() => {
              history.push("/users/profile");
              setSelectedMenuItem("profile");
            }}
          >
            <div>Profile</div>
          </div>
        </Link>
        <Link>
          <div
            className={`sa-menu-link ${
              selectedMenuItem === "profile" ? "selected" : ""
            }`}
            onClick={() => {
              history.push("/");
              props.setUserType("", "");
              sessionStorage.setItem("loggedIn", "false");
            }}
          >
            <div>Logout</div>
          </div>
        </Link>
      </div>
    </div>
  );
};

export default SideNav;
